import 'dart:convert';
import 'package:http/http.dart' as http;
import '../models/story.dart';
import 'mock_story_service.dart';

class StoryService {
  static const String baseUrl = 'http://localhost:8000/api';
  final MockStoryService _mockService = MockStoryService();

  // Replace with your actual API base URLs
  static const String _image_story_api_url = '/story/generate-with-image/';

  Future<Story> getStoryWithValues() async {
    return Story(
      id: "e9d1e6fd-a92e-44b4-babe-0320ea4adeab",
      title: "dragon tale",
      description: "dragon tale",
      storyText: """
Once upon a time, in a far-off land, there was a beautiful dragon named Draco who lived in a magical forest filled with towering trees, sparkling streams, and vibrant wildlife. Draco was known throughout the land for his kind heart and eco-conscious ways. He believed that it was every creature's duty to protect the planet and its natural resources.

One day, a group of mischievous fairies came to visit Draco in his forest home. They were fascinated by the beauty of the forest and the kindness of the dragon. However, they soon realized that their playful actions were causing harm to the environment. They had been carelessly littering and disturbing the natural balance of the forest, without realizing the impact it would have on the wildlife and the planet.

Draco gently chided the fairies, explaining to them the importance of being eco-conscious and protecting the environment. He showed them how their actions were affecting the delicate balance of nature and how it was important to be mindful of their impact on the planet. The fairies were touched by Draco's words and vowed to change their ways.

From that day on, the fairies made a conscious effort to reduce their waste and carbon footprint. They began to recycle, use reusable bags and containers, and plant trees to help clean the air and purify the water. The forest flourished under their care, and the wildlife returned, thriving in the healthy environment.

The moral of the story is that even the smallest actions can make a big difference in protecting the environment. By being mindful of our impact on the planet and making eco-friendly choices, we can help preserve the beauty and magic of nature for future generations to enjoy.

In a very short and fascinating way, the story teaches kids that taking care of the environment is important and everyone's responsibility, no matter how small they may seem. By working together, they can make a big difference in keeping their planet clean and healthy for years to come.""",
      base64Image:
          "data:image/png;base64,",
    );
  }

  Future<List<Story>> getStories({required String themeId}) async {
    try {
      final response = await http
          .post(
            Uri.parse('$baseUrl/story/generate-with-image/'),
            headers: {
              'Content-Type': 'application/json',
              'Accept': 'application/json',
            },
            body: json.encode({
              'theme': themeId,
              'topic': 'Homes of nature',
              'type': 'story',
            }),
          )
          .timeout(Duration(seconds: 10));

      print('Response status: ${response.statusCode}');

      if (response.statusCode == 200) {
        final dynamic data = json.decode(response.body);

        if (data is Map<String, dynamic>) {
          final story = Story.fromJson(data);
          return [story];
        } else if (data is List) {
          final stories =
              data
                  .map((json) => Story.fromJson(json as Map<String, dynamic>))
                  .toList();
          print('Created ${stories.length} stories');
          return stories;
        }
      }

      throw Exception('Failed to load stories: ${response.statusCode}');
    } catch (e) {
      print('API error: $e');
      throw e;
    }
  }

  Future<Story> generateStoryWithImage({
    required String theme,
    required String topic,
    required String type,
  }) async {
    try {
      final response = await http.post(
        Uri.parse('$baseUrl$_image_story_api_url'),
        headers: {'Content-Type': 'application/json'},
        body: json.encode({'theme': theme, 'topic': topic, 'type': type}),
      );

      if (response.statusCode == 200) {
        final data = json.decode(response.body);
        return Story.fromJson(data);
      } else {
        throw Exception('Failed to generate story: ${response.statusCode}');
      }
    } catch (e) {
      throw Exception('Error generating story: $e');
    }
  }
}
